import React from "react";
import './style.scss';
import styled from 'styled-components'

const CardContainer = styled.div`
    margin: 20px;
    width: 400px;
    height: 600px;
    background-color: white;
`

export default function WeitherCard(){
    const [weither, setWeither] = React.useState(false)
    let clima = "Manhã"
    let img = 'Nada'

    if(clima === 'Manhã'){
        img = 'Imagem de Manhã'
    }

    return(
        <CardContainer>
            {clima}
            {img}
        </CardContainer>
    )
}
